class Event():
    def __init__(self, timestamp, location, severity, content):
        self.timestamp = timestamp
        self.location = location
        self.severity = severity
        self.content = content

    def __repr__(self):
        return '<Event timestamp=%r, location=%r, severity=%r, content=%r>' % \
            (self.timestamp, self.location, self.severity, self.content)

